import HomeScreen from './screens/HomeScreen';

function App() {
  return (
    <>
    <Header />
    <main className='py-3'>
      <Container>
        <HomeScreen/>
      </Container>    
    </main>
    <Footer />
    </>
  )
}

export default App;
